      <div className="App">
        <chart />
        <p>Dateselector</p>
      </div>
    );

  let PositionData;
  const PositionSections = PositionData.map(detail =>
    {return (<positions Position={detail}/>)})

  return (
    <div className="App">
      {PositionSections}

    </div>
  );
}



//-------------------------------------------------
//Export
export default App;
